public class OrganizationConfigRuleFactory(string resourceName = null, Action<Humidifier.Config.OrganizationConfigRule> factoryAction = null) : ResourceFactory<Humidifier.Config.OrganizationConfigRule>(resourceName)
{

    internal InnerOrganizationConfigRuleOrganizationManagedRuleMetadataFactory OrganizationManagedRuleMetadataFactory { get; set; }

    internal InnerOrganizationConfigRuleOrganizationCustomRuleMetadataFactory OrganizationCustomRuleMetadataFactory { get; set; }

    internal InnerOrganizationConfigRuleOrganizationCustomPolicyRuleMetadataFactory OrganizationCustomPolicyRuleMetadataFactory { get; set; }

    protected override Humidifier.Config.OrganizationConfigRule Create()
    {
        var organizationConfigRuleResult = CreateOrganizationConfigRule();
        factoryAction?.Invoke(organizationConfigRuleResult);

        return organizationConfigRuleResult;
    }

    private Humidifier.Config.OrganizationConfigRule CreateOrganizationConfigRule()
    {
        var organizationConfigRuleResult = new Humidifier.Config.OrganizationConfigRule
        {
            GivenName = InputResourceName,
        };

        return organizationConfigRuleResult;
    }
    public override void CreateChildren(Humidifier.Config.OrganizationConfigRule result)
    {
        base.CreateChildren(result);

        result.OrganizationManagedRuleMetadata ??= OrganizationManagedRuleMetadataFactory?.Build();
        result.OrganizationCustomRuleMetadata ??= OrganizationCustomRuleMetadataFactory?.Build();
        result.OrganizationCustomPolicyRuleMetadata ??= OrganizationCustomPolicyRuleMetadataFactory?.Build();
    }

} // End Of Class

